{"Data":[{"$":{"ss:Type":"String"}}]},{"Data":[{"$":{"ss:Type":"String"}}]},{"Data":[{"$":{"ss:Type":"String"}}]},{"Data":[{"$":{"ss:Type":"String"}}]},{"Data":[{"_":"Коляска прогулочная GB Beli Air 4 Capri Blue","$":{"ss:Type":"String"}}]},{"Data":[{"_":"Коляски прогулочные","$":{"ss:Type":"String"}}]},{"Data":[{"_":"Детские коляски","$":{"ss:Type":"String"}}]},{"Data":[{"$":{"ss:Type":"String"}}]},{"Data":[{"$":{"ss:Type":"String"}}]},{"Data":[{"$":{"ss:Type":"String"}}]},{"$":{"ss:StyleID":"s21"},"Data":[{"_":"10","$":{"ss:Type":"Number"}}]},{"$":{"ss:StyleID":"s22"},"Data":[{"_":"600.0000","$":{"ss:Type":"Number"}}]},{"$":{"ss:StyleID":"s22"},"Data":[{"$":{"ss:Type":"Number"}}]},{"Data":[{"_":"<p class=\"Usp-description Usp-description--major\">Легкая, маневренная и шикарная. Коляска <strong>Beli Air4</strong> - это идеальный спутник в городе с износостойкими колесами Light. Вместительная корзина для покупок выдерживает до 5 кг. Коляска раскладывается в полностью горизонтальное положение - идеально, если вы на прогулке, а малыш хочет немного отдохнуть. В довершении всего, коляска трансформируется в систему для путешествий. Простое и компактное хранение дома и удобное сложение в общественных местах.</p> <p>Коляска будет удобна не только для малыша, но и для родителей. Удобная регулируемая ручка, надежный ножной тормоз и большая корзина для покупок. На шасси коляски можно поставить автокресло Cybex или GB с помощью адаптера. Колеса из вспененной резины отлично едут по любой поверхности, не прокалываются и обеспечивают мягкий ход.</p> <p>С коляской <strong>GB Beli Air 4</strong> ваши прогулки будут легкими и беззаботными. Вы сможете спокойно гулять с коляской, путешествовать и наслаждаться прогулкой с малышом.</p> <ul> <li>Реверсивное сидение, благодаря которому вы можете возить малыша по ходу или против хода движения.</li> </ul> <p>                 </p> <ul> <li>Просторное сидение с удобными 5-ти точечными ремнями с мягкими накладками. Удобный бампер в комплекте.</li> <li>Несколько наклонов спинки, до полностью горизонтального. Спинка регулируется по типу гамака. Регулируемая подножка увеличит спальное место.</li> </ul> <p>            </p> <ul> <li>Большой и удобный капюшон до бампера. Увеличивается за счет дополнительной секции на молнии с москитной сеткой.</li> </ul> <p>          </p> <ul> <li>Компактно складывается одной рукой. Самостоятельно стоит в сложенном виде.</li> <li>Ручка для родителей регулируется в 3-х положениях.</li> <li>Корзина для продуктов выдерживает вес до 5 кг.</li> <li>Ножной тормоз.</li> <li>Колеса одинарные из вспененной резины. Не прокалываются. Обеспечивают коляске плавный ход.</li> <li>Шасси всего 57 см. Вы без труда проедите в супермаркете, в маленьком лифте или проедите через турникеты.</li> <li>Возможность установить автокресло Cybex или GB с помощью адаптера.</li> <li>Выдерживает вес до 17 кг.</li> </ul> <p><strong>Размеры:</strong></p> <ul> <li>Предназначена для малышей с 6 месяцев</li> <li>Выдерживает до 17 кг</li> <li>Вес 10,3 кг</li> <li>Размер в сложенном виде: 87,5 х 57,0 х 43,5 см (ДхШхВ)</li> <li>Размер с разложенном виде: 89 х 56 х 91 см (ДхШхВ)</li> <li>Ширина колесной базы: 57 см</li> <li>Высота ручки: 104 см</li> <li>Длина спального места: 100 см.</li> <li>глубина сидения: 23 см.</li> <li>ширина сидения: 32 см.</li> <li>высота спинки: 54 см.</li> </ul>","$":{"ss:Type":"String"}}]},{"$":{"ss:StyleID":"s18"},"Data":[{"_":"https://babyroom.by/image/catalog/detskie-koljaski/6/ets-images-products-13760-blyu.jpg","$":{"ss:Type":"String"}}]},{"$":{"ss:StyleID":"s18"},"Data":[{"_":"https://babyroom.by/image/catalog/detskie-koljaski/6/ets-images-products-13760-m416760-861x855.jpg","$":{"ss:Type":"String"}}]},{"$":{"ss:StyleID":"s18"},"Data":[{"_":"https://babyroom.by/image/catalog/detskie-koljaski/6/ets-images-products-13760-1107666-1.jpg","$":{"ss:Type":"String"}}]},{"$":{"ss:StyleID":"s18"},"Data":[{"$":{"ss:Type":"String"}}]},{"$":{"ss:StyleID":"s18"},"Data":[{"$":{"ss:Type":"String"}}]}